import React, { Component } from 'react';
import "./Work.css";

export default class Work extends Component {

    state = {
        width: 0,
        height: 0
    }

    Show = (event) => {

        let value = event.target.value
        this.setState ({
            width: value,
            height: value
        })
        
        
        
    }

    render() {
        return (
            <div>
                <div className='c'>

                <input type="number" placeholder='Width' onInput={this.Show} className='width' />
                <input type="number" placeholder='hight' onInput={this.Show} className='height'/>
                </div>
                <button >Chizish</button>
            </div>
        )
    }
}
